// frontend/src/App.js
import React from 'react';
import './App.css'; 
// Đổi tên import
import LeafletMapComponent from './MapContainer';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Bản đồ Ẩm thực Hà Nội (Leaflet.js)</h1>
      </header>
      <div style={{ padding: '20px' }}>
        <LeafletMapComponent />
      </div>
    </div>
  );
}

export default App;
